import React from 'react';

const ServiceContainer = ({ id, style, children, isWhite }) => {
  const containerClass = isWhite ? 'service-container white-polygon' : 'service-container';
  return (
    <div className={containerClass} id={id} style={style}>
      {children}
    </div>
  );
};

export default ServiceContainer;
